import React, {Component} from 'react';
import Feira from '../../components/Feira/Feira';

class Feiras extends Component {
    state = {
        feira:{
            nome: "teste",
            local: "locali"
        }
    }

    
    componentDidMount() {
        console.log(this.state);
    }

    render(){

        return(
            <div>
                <Feira local={this.state.feira.local} nome={this.state.feira.nome}></Feira>
                <Feira></Feira>
            </div>
        );
    };
}

export default Feiras;
